import React from 'react'

const todos= ["Einkaufen", "Lesen", "Laufen", "Bad putzen", "Kochen", "Wäsche waschen", "Donnerstag: Spieleabend", "Kuchen backen", "Lucy anrufen"];

function ToDo() {
  return (
    <div className="toDoBoard">
    {todos.map((todo, index) => (
      <div className="toDo" key={index}>
        <div>{todo}</div>
      </div>
    ))}
    </div>
  )
}

export default ToDo
